import React from "react";
import * as d3 from "d3";

/**
 * Uncontrolled component that graphs a HeatMap given a data set and dimensions of the graph.
 * @param {*} param0 
 * @returns 
 */
const HeatMap = ({ data, dimensions }) => {

    // create svg element:
    var svgRef = d3.select("#rect").append("svg").attr("width", 10).attr("height", 10)

    // Add the path using this helper function
    svgRef.append('rect')
    .attr('x', 10)
    .attr('y', 10)
    .attr('width', 10)
    .attr('height', 10)
    .attr('stroke', 'black')
    .attr('fill', '#69a3b2');

    // Return the new svg component
    return <svg ref={svgRef} width={10} height={10}/>;
}

export default HeatMap;
